[Form]
public class ReqItemJournalSafetyStock extends FormRun implements LedgerIJournalForm
{
    JournalFormTrans    journalFormTrans;
    InventDimCtrl_Frm   inventDimFormSetup;
    JournalFormTable    journalFormTable;
    boolean             inCreate;
    boolean             inDelete;

}

public void initButtons()
{
    JournalTableMap journalTableMap = journalFormTrans.getJournalFormTable().journalTableData().journalTable();
    boolean hasLines = journalTableMap && journalTableMap.NumOfLines > 0;
    boolean isPosted = journalTableMap && journalTableMap.Posted;
    boolean isNotBlocked = JournalTableData::journalBlockLevel(journalTableMap) == JournalBlockLevel::None || journalTableMap.SessionId == sessionid();

    CreateLinesInLinesView.enabled(!isPosted && isNotBlocked && !hasLines);
    DeleteLinesInLinesView.enabled(!isPosted && isNotBlocked && hasLines);
}

void init()
{
    ReqParameters::checkPlanningProcessesAreEnabled();

    journalFormTable = new JournalFormTable(element);
    journalFormTrans = new JournalFormTrans(element);

    journalFormTrans.parmJournalFormTable(journalFormTable);

    super();

    journalFormTrans.parmCtrlCheckJournal(checkJournal);
    journalFormTrans.parmCtrlPostJournal(postJournal);
    journalFormTrans.parmCtrlInfolog(showInfolog);
    journalFormTrans.parmCtrlLineLogImage(overview_lineLogImage);

    journalFormTable.parmCtrlJournalTypeGrid(ctrlGridJournalType);
    journalFormTable.parmCtrlJournalIdGrid(ctrlGridJournalId);
    journalFormTable.parmCtrlAllOpenPosted(allOpenPosted);
    journalFormTable.parmCtrlMarkInUseBlock(markInUseBlock);
    journalFormTable.parmCtrlBlockImage(ReqItemJournalTable_Blocked);
    journalFormTable.parmCtrlCheckJournal(checkJournal);
    journalFormTable.parmCtrlPostJournal(postJournal);
    journalFormTable.parmCtrlInfolog(showInfolog);
    journalFormTable.formInitPost();

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

public int task(int _taskId)
{
    int ret;
    #task;

    ret = super(_taskId);

    if (_taskId == #TaskEditRecord || _taskId == #taskDoneEditRecord)
    {
        journalFormTrans.editViewModeChanged();
        journalFormTrans.datasourceLinkActivePre();
    }

    return ret;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventDimParm   inventDimParmShow;
    InventDimParm   inventDimParmEnabled;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (! inventDimFormSetup)
                inventDimFormSetup  = InventDimCtrl::newFromForm(element);
            inventDimParmShow.initCovDimAllGrp();
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmShow);

        case InventDimFormDesignUpdate::Active, InventDimFormDesignUpdate::FieldChange :
            inventDimParmEnabled.initCovPrDimension(InventDimGroupSetup::newItemId(reqItemJournalTrans.ItemId));
            inventDimFormSetup.parmDimParmEnabled(inventDimParmEnabled);
            inventDimFormSetup.formSetControls(true);
            break;

        default : throw error(strfmt("@SYS54195",funcname()));
    }
}

edit JournalMarkInUseBlock inUseBlock(boolean _set, JournalTableMap _journalTable, JournalMarkInUseBlock _value)
{
    return journalFormTable.datasourceMethodInUseBlock(_set,_journalTable,_value);
}

public boolean leave()
{
    boolean ret = true;
    if (!inCreate && !inDelete)
    {
        ret = journalFormTable.datasourceLeavePre();
    }

    ret = ret && super();

    return ret;
}

public boolean validateDelete()
{
    boolean ret;

    ret = super();

    ret = journalFormTable.datasourceValidateDeletePost(ret);

    return ret;
}

void create(boolean _append = false)
{
    inCreate = true;
    if (! journalFormTable.datasourceCreatePre())
    {
        inCreate = false;
        return;
    }

    super(_append);

    journalFormTable.datasourceCreatePost();
    inCreate = false;

    reqItemJournalTrans_ds.executeQuery();
}

boolean validateWrite()
