public boolean validateWrite()
{
    boolean     ret;

    reqItemJournalTrans.InventDimId = InventDim::findOrCreate(inventDim).InventDimId;
    inventDim.clearNotCovPrDim(InventDimGroupSetup::newItemId(reqItemJournalTrans.ItemId));

    ret = super();

    ret = ret && inventdim.checkDimFieldsValid(reqItemJournalTrans.ItemId,null);

    ret = journalFormTrans.datasourceValidateWritePost(ret);

    return ret;
}

